import React from "react";

const InputField = (props) => {
  console.log(props);
  return (
    <div className="form__group form__group">
      <label htmlFor={props?.props?.id}>Full Name</label>
      {/* <input
        id={props?.props?.id}
        name={name?.name}
        type={type?.type}
        placeholder={placeholder?.placeholder}
      /> */}
    </div>
  );
};

export default InputField;
